import { Main } from "./src/Screens/Main";
import { Header } from "./src/Components/Header";
import { StyleSheet, View } from "react-native";

export default function App() {
  return (
    <View style={styles.home}>
      <Header />
      <Main />
    </View>
  );
}

const styles = StyleSheet.create({
  home: {
    flex: 1,
  },
});
